INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AKA', 'STOCK', 'a.k.a. Brands Holding Corp.', 'NYQ', 'Consumer Cyclical', 'Apparel Retail', 'a.k.a. Brands Holding Corp. maintains a portfolio of global fashion brands, which includes two womens brands, Princess Polly and Petal & Pup, and two streetwear brands, Culture Kings and mnml. The Company reaches an audience of consumers who seek fashion inspiration on social media and primarily shop online. Princess Polly is a fashion brand focused on fun, trendy dresses, tops, shoes and accessories with slim-fit, body-confident and trendy fashion designs. The brand targets a female customer between the ages of 15 and 25. Petal & Pup is a fashion brand offering an assortment of trendy, flattering and feminine styles and dresses for special occasions. Culture Kings brand is an online retailer of streetwear apparel, footwear, headwear and accessories. The brand targets male consumers between the ages of 18 and 35 who are fashion conscious, highly social and digitally focused. mnml is a streetwear brand that offers competitively priced, on-trend wardrobe staples.', 'San Francisco, CA, United States', 1350);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BSJW', 'STOCK', 'Invesco BulletShares 2032 High Yield Corporate Bond ETF', 'NGM', NULL, NULL, 'The fund generally will invest at least 80% of its total assets in securities that comprise the underlying index. The underlying index seeks to measure the performance of a portfolio of U.S. dollar-denominated high yield corporate bonds with maturities or, in some cases, “effective maturities” in the year 2032. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DVQQ', 'STOCK', 'WEBs Defined Volatility QQQ ETF', 'NGM', NULL, NULL, 'The manager implements its investment objective by investing, under normal market conditions, at least 80% of its net assets in financial instruments that achieve the investment results of the index. The index is a rules-based strategy that seeks to track the performance of the Invesco QQQ TrustSM, Series 1, with investment exposure to the underlying ETF adjusted for a targeted annual volatility rate of 22%. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CCNEP', 'STOCK', 'CNB Financial Corporation', 'NMS', 'Financial Services', 'Banks - Regional', 'CNB Financial Corporation is a financial holding company. The Company conducts business primarily through its principal subsidiary, CNB Bank (the Bank). The Bank is a full-service bank engaging in a full range of banking activities and services, including trust and wealth management services, for individual, business, governmental, and institutional customers. The Banks operations include a private banking division, and 78 branches comprised of one loan production office, one drive-up office, one mobile office, and 75 full-service offices in Pennsylvania, Ohio, New York, and Virginia. Its divisions include ERIEBANK, based in Erie, Pennsylvania; FCBank, based in Worthington; BankOnBuffalo, based in Buffalo, New York; Ridge View Bank, based in Roanoke, Virginia; ESSA Bank, based in Stroudsburg, Pennsylvania, and Impressia Bank, a division focused on banking opportunities for women, which operates in CNB Bank''s primary market areas.', 'Clearfield, PA, United States', 769);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DUKX', 'STOCK', 'Ocean Park International ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund (“ETF”) that seeks to achieve its investment objective by tactically allocating the fund’s assets between unaffiliated international equity ETFs and cash equivalents. Under normal market conditions, the advisor expects to invest substantially all of its assets in underlying ETFs.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BUFM', 'STOCK', 'AB Moderate Buffer ETF', 'NGM', NULL, NULL, 'The fund seeks to achieve its investment objective by investing, under normal conditions, substantially all of its assets in a combination of exchange-traded options contracts on an underlying ETF. The underlying ETF (initially expected to be the SPDR® S&P 500® ETF Trust) is an ETF that seeks to track the investment results of the S&P 500 Index. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OXLCO', 'STOCK', 'Oxford Lane Capital Corp.', 'NMS', 'Financial Services', 'Asset Management', 'Oxford Lane Capital Corp. (the Fund) is a closed-end management investment company. The Funds investment objective is to maximize its portfolios risk-adjusted total return. The Fund seeks to achieve its investment objective by investing in structured finance investments, specifically the equity and junior debt tranches of collateralized loan obligation (CLO) vehicles, which are collateralized primarily by a diverse portfolio of senior secured loans made to companies whose debt is unrated or is rated below investment grade (the Senior Loans) and, to a limited extent, subordinated and/or unsecured loans and bonds (CLO Assets). Below investment grade securities, such as the CLO securities in which the Fund primarily intends to invest, are often referred to as junk. The Funds investment activities are managed by Oxford Lane Management, LLC (Oxford Lane Management), which is its investment adviser.', 'Greenwich, CT, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CUB', 'STOCK', 'Lionheart Holdings', 'NGM', 'Financial Services', 'Shell Companies', 'Lionheart Holdings is a blank check company. The Company is formed for the purpose of effecting a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization or similar business combination with one or more businesses. It has no operations and has not generated any revenue.', 'Miami, FL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('EFRA', 'STOCK', 'iShares Environmental Infrastructure and Industrials ETF', 'NGM', NULL, NULL, 'The fund seeks to track the investment results of the index, which has been developed by FTSE International Limited (the “index provider” or “FTSE”). It is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ACLO', 'STOCK', 'TCW AAA CLO ETF', 'NYQ', NULL, NULL, 'The fund will invest, under normal circumstances, at least 80% of the value of its net assets, plus the amount of any borrowings for investment purposes, in U.S. dollar-denominated CLOs that are, at the time of purchase, rated AAA by at least one of the major rating agencies or, if unrated, determined by the adviser to be of comparable quality. The fund is non-diversified.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DWUS', 'STOCK', 'AdvisorShares Dorsey Wright FSM US Core ETF', 'NGM', NULL, NULL, 'The fund is an actively managed exchange-traded fund ("ETF") that is primarily a "fund of funds." The Advisor seeks to achieve it''s investment objective by investing in ETFs that invest primarily in domestic large capitalization equity securities. The fund invests in fixed income ETFs with a short or ultra-short duration, money market funds, cash and cash equivalents ("Defensive Investments"). It may invest in affiliated and unaffiliated ETFs. Under normal circumstances, the fund invests at least 80% of its net assets in U.S. investments.', '', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('OAKU', 'STOCK', 'Oak Woods Acquisition Corporation', 'NCM', 'Financial Services', 'Shell Companies', 'Oak Woods Acquisition Corporation is a blank check company. The Company is formed for the purpose of entering into a merger, stock exchange, asset acquisition, share purchase, recapitalization, reorganization or similar business combination with one or more businesses. It is engaged in the organizational activities and those necessary to prepare for the initial public offering and, after the initial public offering, identifying a target company for a business combination. The Company has neither engaged in any operations nor generated any operating revenues to date.', 'Nepean, ON, Canada', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('AACBU', 'STOCK', 'Artius II Acquisition Inc.', 'NGM', 'Financial Services', 'Shell Companies', 'Artius II Acquisition Inc. does not have significant operations. It intends to effect a merger, amalgamation, share exchange, asset acquisition, share purchase, reorganization, or similar business combination with one or more businesses. It intend to focus on technology enabled businesses that offer technology software and services, or financial services. The company was incorporated in 2024 and is based in New York, New York.', 'New York, NY, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DMAAU', 'STOCK', 'Drugs Made In America Acquisition Corp.', 'NGM', 'Financial Services', 'Shell Companies', 'Drugs Made In America Acquisition Corp. does not have significant operations. It intends to effect a merger, share exchange, asset acquisition, share purchase, recapitalization, reorganization, or other similar business combination with one or more businesses. Drugs Made In America Acquisition Corp. was incorporated in 2024 and is based in Fort Lauderdale, Florida.', 'Fort Lauderdale, FL, United States', NULL);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('CVR', 'STOCK', 'Chicago Rivet & Machine Co.', 'ASE', 'Industrials', 'Tools & Accessories', 'Chicago Rivet & Machine Co. operates in the fastener industry. The Company operates through two segments: fastener and assembly equipment. The fastener segment, which comprises the Companys wholly-owned subsidiary, H&L Tool Company Inc., and the Companys fastener operations, which consists of the manufacture and sale of rivets, cold-formed fasteners and parts, and screw machine products. The assembly equipment segment consists primarily of the manufacture of automatic rivet setting machines and parts and tools for such machines. The principal market for the Companys products is the North American automotive industry. Its Madison Heights, Michigan facility is used entirely in the fastener segment. Its Albia, Iowa facility is used exclusively in the assembly equipment segment. Its Tyrone and Pennsylvania facilities are utilized in both segments.', 'Naperville, IL, United States', 161);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('BEDU', 'STOCK', 'Bright Scholar Education Holdings Limited', 'NYQ', 'Consumer Defensive', 'Education & Training Services', 'Bright Scholar Education Holdings Ltd is a company primarily engaged in the provision of international education services. The Company operates its business through three segments. The Overseas Schools segment mainly engages in the acquiring of overseas schools and language training institutions in countries such as the United Kingdom and the United States. The Complementary Education Services segment mainly engages in the provision of camp programs, after-school programs, overseas study consulting services, and career counselling and international contest training services. The Domestic Kindergartens and K-12 Operation Services segment mainly engages in the operation of domestic kindergartens and other businesses. The Company conducts its business in the domestic and overseas markets.', 'Cambridge, , United Kingdom', 2193);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('DIT', 'STOCK', 'AMCON Distributing Company', 'ASE', 'Consumer Defensive', 'Food Distribution', 'AMCON Distributing Company is a convenience and foodservice distributor of consumer products, including beverages, candy, tobacco, groceries, foodservice, frozen and refrigerated foods, automotive supplies and health and beauty care products. The Companys Wholesale Segment includes its Team Sledd, LLC and Henrys Foods, Inc. subsidiaries, which distributes consumer products and provides a full range of programs and services to its customers. It operates over 13 distribution centers in Colorado, Illinois, Indiana, Minnesota, Missouri, Nebraska, North Dakota, South Dakota, Tennessee and West Virginia. It serves customers primarily in the Central, Rocky Mountain, Great Lakes, Mid-South and Mid-Atlantic regions of the United States. Its Retail Segment, through its Healthy Edge Retail Group subsidiary, is a specialty retailer of natural/organic groceries and operates 15 retail health food stores under the Chamberlins Natural Foods, Akins Natural Foods, and Earth Origins Market banners.', 'Omaha, NE, United States', 1362);\n
INSERT INTO assets_master (ticker, asset_type, name, exchange, sector, industry, business_description, headquarters, employees_count) VALUES ('ENJ', 'STOCK', 'Entergy Utility Group, Inc. 1ST MTG 5% 52', 'NYQ', NULL, NULL, 'Entergy New Orleans, LLC is an electric and gas utility company. The Company is engaged in the generation, transmission, distribution, and sale of electric power. The Company owns an 870 megawatt (mg) Michoud Plant generating station. Its Michoud Plant located in eastern New Orleans. The Company is also engaged in operating a natural gas distribution business.', '', NULL);\n\n-- INSERÇÃO MASSIVA EM STOCK_METRICS_SNAPSHOT\n
